import React, { Component } from 'react';

export default class TodosList extends Component {

    constructor(props) {
        super(props);

        this.state = {
            todo_description: 'Test Desc',
            todo_responsible: 'Test Resp',
            todo_priority: 'Test Prio',
            todo_completed: false
        }
    }

    render() {
        return (
            <div>
                <p>Welcome to Todos List Component!!</p>
                <p>{this.state.todo_description}</p>
                <p>{this.state.todo_responsible}</p>
                <p>{this.state.todo_priority}</p>
            </div>
        )
    }
}
